var tipuesearch = {"pages": [{'title': 'About', 'text': '41123209吳振宇 \n 於11/30開始維護個人網站 \n 在反覆觀看上課影片以及多次詢問同學嘗試維護中\xa0 \n  https://github.com/mdecycu/cmsite  \n', 'tags': '', 'url': 'About.html'}, {'title': 'Inventor', 'text': '\xa0 AutoDesk 公司旗下的電腦輔助機械設計套件都提供 免付費教育版 . 其中 Inventor 可 直接從學校網站下載 , 且 教育版的 A360 \xa0可在雲端或近端啟動, 但近端必須安裝對應套件. \n 我是使用AutoDesk的教育資源(https://www.autodesk.com.tw/education/home)透過認證學校註冊且取得產品. \n 先準備註冊單和個人學生證,再School中搜尋虎尾科技大學並且選取,再填上註冊學年與畢業學年等候2-3個工作日就可以在信箱中確認是否通過認證,如下圖. \n \n 這是我獲得產品證明與使用年份,如下圖. \n \n', 'tags': '', 'url': 'Inventor.html'}, {'title': '分組作業', 'text': '', 'tags': '', 'url': '分組作業.html'}, {'title': '任務一', 'text': '磁力吸引 \n 我分配到的是Inventor \n 使用Inventor繪製草圖,建立零件,零件組合 \n 參考 Perpetual Motion Simulator in Onshape 中的尺寸繪製 \n', 'tags': '', 'url': '任務一.html'}, {'title': '零件繪製', 'text': '底座草圖尺寸 \n \n 建立零件 \n \n 圓盤草圖尺寸 \n \n 建立零件 \n \n U型管草圖尺寸 \n \n 建立零件 \n \n \n', 'tags': '', 'url': '零件繪製.html'}, {'title': '組合圖', 'text': '完整組合圖 \n \n 完整組合圖(右視圖) \n \n 約束(1) \n \n 約束(2) \n \n \n', 'tags': '', 'url': '組合圖.html'}, {'title': '繪製過程影片', 'text': '\n Inventor繪製過程影片 \n \n', 'tags': '', 'url': '繪製過程影片.html'}, {'title': '作業', 'text': '', 'tags': '', 'url': '作業.html'}, {'title': 'w11', 'text': 'pms \n 平面上滾動的鋼球永動模擬器, 也算 perpetual motion simulator (pms) 中的一種: \n https://youtu.be/O-FKcK0vzgY \n', 'tags': '', 'url': 'w11.html'}, {'title': 'Wink', 'text': '學習如何利用 \xa0 Wink \xa0 製作電腦操作流程影片, 並將影片放入個人與分組網頁中. \n 首先使用者必須了解 \xa0 Wink \xa0 製作影片的功能與 \xa0 ShareX \xa0 相同, 都是依賴 \xa0 ffmpeg.exe . 意即使用 \xa0 Wink \xa0 之前必須在 Preferences 中先行設定 ffmpeg.exe 所在位置, 否則無法對所建立的專案轉為 mp4 檔案. \n 另外, 若擷取關鍵影格的電腦螢幕解析度大於 1008 x 630, 通常建立將影格 resize, 以方便使用者在手機上觀看影片. \n 利用 Wink 建立操作影片的步驟: \n \n 設定 ffmpeg.exe 所在位置, 若使用隨身碟中的可攜程式系統, 可將 ffmpeg.exe 放在 data 目錄中, 並以 wink_ffmpeg.reg 進行設定, 也可將 Wink 的啟動與 start_ipv6.bat 進行整合. \n 開啟 Wink 新專案. \n 每按下一次 Pause 鍵, 可擷取操作過程中的畫面影格 (利用 Zoomit 放大所要強調的操作內容, 並以紅線框列). \n 操作錄製結束後, 從右下方的 Tray 中, 以滑鼠左鍵點選, 在 Wink 圖示中, 以滑鼠右鍵帶出 Finish Capture 按鍵, 點選後即可回到 Wink 專案區. \n 在每一頁影格中加入註解說明 TextBox 之前, 先利用 Project - Resize All Frames 將影格縮小至 1008 x630. \n 完成註解說明後, 可以逐一移動各頁面滑鼠游標位置, 並決定各頁面影片播放時的停留時間. \n 最後以 Render 按鈕進行轉檔, 並利用 View Rendered Output 檢視所建立的操作影片. \n \n', 'tags': '', 'url': 'Wink.html'}, {'title': 'Wink 過程操作說明影片', 'text': '尚未錄製影片 \n 努力維護中 \n \n', 'tags': '', 'url': 'Wink 過程操作說明影片.html'}, {'title': 'w12', 'text': '學號/t座位座標.txt \n', 'tags': '', 'url': 'w12.html'}, {'title': '網路設定', 'text': '示範影片 \n 網路設定 \n 下載網路設定檔\xa0\xa0 網路設定檔案 \n 在SCITE編輯器上修改副檔名.ps1中的IPv6固定位址,確認自己的IPv6 address並修改上去 \n', 'tags': '', 'url': '網路設定.html'}, {'title': '零組件繪圖', 'text': 'AutoDesk 公司旗下的電腦輔助機械設計套件都提供 免付費教育版 . 其中 Inventor 可 直接從學校網站下載 , 且 教育版的 A360 \xa0可在雲端或近端啟動, 但近端必須安裝對應套件. \n 我是使用AutoDesk的教育資源(https://www.autodesk.com.tw/education/home)透過認證學校註冊且取得產品. \n 先準備註冊單和個人學生證,再School中搜尋虎尾科技大學並且選取,再填上註冊學年與畢業學年等候2-3個工作日就可以在信箱中確認是否通過認證,如下圖. \n \n', 'tags': '', 'url': '零組件繪圖.html'}, {'title': '零件繪圖', 'text': '底座草圖建立零件 \n \n 圓盤草圖建立零件 \n \n U型管草圖建立零件 \n \n \n', 'tags': '', 'url': '零件繪圖.html'}, {'title': '組件繪圖', 'text': '零件約束(1) \n 零件約束(2) \n \n 組合圖(右視圖) \n \n 組合圖 \n \n', 'tags': '', 'url': '組件繪圖.html'}, {'title': '轉出 STL 零組件檔案', 'text': '在Inventor轉出STL檔示範 \n 圖檔 \n', 'tags': '', 'url': '轉出 STL 零組件檔案.html'}, {'title': '匯入圖檔', 'text': 'STL匯入 \xa0CoppeliaSim \n', 'tags': '', 'url': '匯入圖檔.html'}, {'title': '系統模擬', 'text': '努力維護中 \n \n \n \n \n \n', 'tags': '', 'url': '系統模擬.html'}, {'title': '鋼球落點座標測驗', 'text': '\n \n 從 這裡 可以取得支援 IPv6 網路協定的 \xa0 CoppeliaSim 與 ZMQ remote API Python 程式範例 , 請利用 Wink 製作執行此一範例程式的 操作影片檔 後, 放入個人網站中的 w12 頁面中 \n \n \n 從上列程式範例, 已知 \xa0 simAddForceAndTorque \xa0 可 對場景中物體的質心施力與施轉矩 , 而 \xa0 simAddForce \xa0 則可對場景中的物體 任一位置施力 , 此外利用 \xa0 simGetObjectPosition \xa0 可以在特定時間點取得物件位置, 請根據上列鋼球永動模擬器的場景與 ZMQ remote API Python 程式, 以 platform \xa0 圓孔上緣作為參考原點座標 , 延伸出一個足夠大小的 平面範圍 , 測試利用上述兩種施力函式, 在鋼球通過感測器時, 對鋼球施以不同大小的力或轉矩後, 進行鋼球在目標平面上的落點分析, 並設法依此 落點實驗, 找出能讓鋼球正好落在 platform 範圍的施力或轉矩大小 \n \n \n \n \n \n \n \n', 'tags': '', 'url': '鋼球落點座標測驗.html'}, {'title': 'w14', 'text': '電磁力吸引 \n 實際操作如何執行\xa0 project1_w14_simple.7z \xa0(電磁力吸引) 的控制程式 \n 操作影片使用wink錄製 \n 影片 \xa0 \n', 'tags': '', 'url': 'w14.html'}, {'title': 'exam', 'text': '平面上滾動的鋼球永動模擬器 \n 影片 \n 繪製圖檔 \n 轉stl檔過程 \n stl匯入 \n \n', 'tags': '', 'url': 'exam.html'}, {'title': '個人評分項目', 'text': '自評分數:60 \n 已將所有課程影片觀看完畢 \n A: 是否按照進度明確標示倉儲的改版歷程(已完成) 圖片1 圖片2 \n B: 是否根據 \xa0 IPv4 與 IPv6 \xa0 網路環境設定進行作法討論已完成) 網路設定 \n C: 是否就 \xa0 Replit、s.cycu.org 與 localhost \xa0 情境下對個人與分組倉儲進行設定操作(已完成) \n D: 是否就所分配的 \xa0 CAD 套件 從安裝設定到繪圖提供內容參考(已完成) Inventor \n E: 是否使用所分配的 CAD 套件完成 專案一零組件繪圖 , 並提供零組件下載(已完成) 圖檔 \n F: 是否將自行繪製的專案一零組件 轉入 CoppeliaSim(已完成) STL匯入 \n G: 是否利用 \xa0 ZMQ Remote API Python \xa0 對專案一轉入的零組件設定感測器, 並進行 鋼球永動模擬(已完成) 影片 \n H: 是否實際操作 \xa0 Triangle 軌道系統 的鋼球永動模擬(未完成) \n I: 是否完成 W15 的平面雙 U 迴路上的 鋼球永動系統繪圖、轉檔與系統模擬(已完成) 影片 \n J: 是否使用所分配的 CAD 套件完成 專案二 1D 平台零組件繪圖 , 並提供零組件下載(已完成) 圖檔 \n K: 是否利用 \xa0 ZMQ Remote API Python \xa0 對專案二轉入的零組件設定感測器, 並進行鋼球永動模擬(進行中) \n L: 是否針對專案二的 1D 平台鋼球平衡系統所需的 \xa0 PID 控制理論 進行資料收集與 ChatGPT 對答(未進行) \n \xa0 \n', 'tags': '', 'url': '個人評分項目.html'}, {'title': '心得', 'text': '其實我在一上的課是被當的,且對於前幾週的課程可說是漠不關心. \n 但是我最近在LOL韓服鑽一到大師中受盡挫折,且在Netflix上觀看到 騎上獨角獸 ,我重新思考自我的價值,並且試圖找回學習的熱忱.我知道我不能在一個晚上將過去的作業都補完,但剩下的幾週我會嘗試的. \n \n', 'tags': '', 'url': '心得.html'}, {'title': 'Brython', 'text': 'https://en.wikipedia.org/wiki/Python_(programming_language) \n Examples: \n https://gist.github.com/mdecycu/d9082d678096bd58378d6afe2c7fa05d \n https://www.geeksforgeeks.org/python-programming-examples/ \n https://www.programiz.com/python-programming/examples \n https://www.freecodecamp.org/news/python-code-examples-sample-script-coding-tutorial-for-beginners/ \n Python Tutorial: \n https://docs.python.org/3/tutorial/ \n An informal introduction to Python \n Indentation (Python 採 4 個 Spaces 縮排, 以界定執行範圍) \n Variables ( Python Keywords ) \n Comments (# 單行註解, 三個單引號或三個雙引號標註多行註解) \n Numbers  (整數 int(), 浮點數 float()) \n Strings  (字串) \n print (Python 內建函式,  print()  函式) \n Python control flow tools \n for \n if \n range \n open \n read \n lists \n tuples \n dictionaries \n functions \n try ... except \n break \n pass \n classes \n 這個頁面 demo 如何在同一頁面下納入多個線上 Ace 編輯器與執行按鈕 ( practice_html.txt  動態頁面超文件). \n practice_html.txt  動態頁面超文件應該可以在啟動 Brython 時, 設定將 .py 檔案放入 downloads/py 目錄中引用. \n 亦即將所有對應的 html 也使用 Brython 產生, 然後寫為  class  後, 在範例導入時透過  instance  引用. \n <!-- 啟動 Brython -->\n<script>\nwindow.onload=function(){\nbrython({debug:1, pythonpath:[\'./../cmsimde/static/\',\'./../downloads/py/\']});\n}\n</script> \n 從 1 累加到 100: \n 1 add to 100 \n 將 iterable 與 iterator  相關說明 , 利用 Brython 與 Ace Editor 整理在這個頁面. \n  導入 brython 程式庫  \n \n \n \n \n  啟動 Brython  \n \n \n \n  導入 FileSaver 與 filereader  \n \n \n \n \n  導入 ace  \n \n \n \n \n \n \n  導入 gearUtils-0.9.js Cango 齒輪繪圖程式庫  \n \n \n \n \n \n \n  請注意, 這裡使用 Javascript 將 localStorage["kw_py_src1"] 中存在近端瀏覽器的程式碼, 由使用者決定存檔名稱 \n \n \n \n \n \n \n  add 1 to 100 開始  \n \n \n  add 1 to 100 結束 \n  editor1 開始  \n  用來顯示程式碼的 editor 區域  \n \n  以下的表單與按鈕與前面的 Javascript doSave 函式以及 FileSaver.min.js 互相配合  \n  存擋表單開始  \n Filename:  .py   \n  存擋表單結束  \n \n  執行與清除按鈕開始  \n Run   Output   清除輸出區 清除繪圖區 Reload \n  執行與清除按鈕結束  \n \n  程式執行 ouput 區  \n \n  Brython 程式執行的結果, 都以 brython_div1 作為切入位置  \n \n  editor1 結束   ##########################################  \n 從 1 累加到 100 part2: \n 1 add to 100 cango_three_gears BSnake AI Tetris Rotating Block \n  請注意, 這裡使用 Javascript 將 localStorage["kw_py_src2"] 中存在近端瀏覽器的程式碼, 由使用者決定存檔名稱 \n \n \n \n  add 1 to 100 part2 開始  \n \n \n  add 1 to 100 part2 結束 \n  editor2 開始  \n  用來顯示程式碼的 editor 區域  \n \n  以下的表單與按鈕與前面的 Javascript doSave 函式以及 FileSaver.min.js 互相配合  \n  存擋表單開始  \n Filename:  .py   \n  存擋表單結束  \n \n  執行與清除按鈕開始  \n Run   Output   清除輸出區 清除繪圖區 Reload \n  執行與清除按鈕結束  \n \n  程式執行 ouput 區  \n \n  Brython 程式執行的結果, 都以 brython_div1 作為切入位置  \n \n  editor2 結束  \n \n \n', 'tags': '', 'url': 'Brython.html'}]};